function showMenu() {
    var wrapper = $('html'),
        a = document.getElementById("body_fpt_online"),
        b = document.getElementById("btn_show_menu"),
        c = document.getElementById("showNavSideMenu"),
        d = $(".btn_show_search");

    wrapper.animate({
        scrollTop: 0
    });

    if (a.className.indexOf("menu-open") === -1) {
        a.className += " menu-open";
    } else {
        a.className = a.className.replace(" menu-open", "");
    }

    if (b.className.indexOf("active") === -1) {
        b.className += " active";
    } else {
        b.className = b.className.replace(" active", "");
    }

    if (c.className.indexOf("show") === -1) {
        c.className += " show";
    } else {
        c.className = c.className.replace(" show", "");
    }

    if (d.className.indexOf("hidden") === -1) {
        d.className += " hidden";
    } else {
        d.className = d.className.replace(" hidden", "");
    }
    return false;
}
function showSearch() {
    var wrapper = $('html'),
        a = document.getElementById("search_area"),
        b = document.getElementById("btn_show_search");

    wrapper.animate({
        scrollTop: 0
    });

    if (a.className.indexOf("show") === -1) {
        a.className += " show";

    } else {
        a.className = a.className.replace(" show", "");
    }

    if (b.className.indexOf("active") === -1) {
        b.className += " active";
    } else {
        b.className = b.className.replace(" active", "");
    }

    return false;
}


$(document).on('click','.btn_showSearch',function (z){
    z.preventDefault();
    var wrapper = $('html'),
        a = document.getElementById("search_area"),
        c = $('input-search'),
        that = $(this);

    wrapper.animate({
        scrollTop: 0
    });

    if (a.className.indexOf("show") === -1) {
        a.className += " show";
        $('.input-search').focus();
        that.addClass('active');

    } else {
        a.className = a.className.replace(" show", "");
        that.removeClass('active');
    }


    return false;
});



