var Boxlayout = (function() {
    var wrapper, sections, closeButtons, expandedClass, hasExpandedClass;

    wrapper = document.body;
    sections = Array.from(document.querySelectorAll(".section"));
    closeButtons = Array.from(document.querySelectorAll(".close-section"));
    expandedClass = "is-expanded";
    hasExpandedClass = "has-expanded-item";


    return {
        init: init
    };

    function init() {

        _onload();
        _initCheckScroll();
        $(window).scroll(_initCheckScroll);
        $(window).on('load resize', function() {
            setHeightSlideHome();
        });
        _galleryGrid();
        _counterUp();

    }

    /* Start excute js onload page Area js
    ============================================================================================ */
    function _onload() {


        $(document).ready(function() {
            calculateHeightBody();
            $(window).on('resize', function() {
                calculateHeightBody();
            });

            // $(window).scroll(function() {
            //     if ($(this).scrollTop() > 100) $('#goTop').fadeIn();
            //     else $('#goTop').fadeOut();
            // });
            // 
            if (window.location.hash) {
                var hash = window.location.hash;
                $('html, body').animate({
                    scrollTop :  $(hash).offset().top-65
                }, 500);
            };
            
            $(document).on('click','.btn-go-top, #goTop', function (e){
                e.preventDefault();
                $('html,body').animate({
                    scrollTop: 0
                },'slow');
                return false;
            });

            $('a.scrollDiv').on('click', function (e){
                e.preventDefault();

                var id = $(this).attr('href');
                $(this).parent().addClass("active").siblings().removeClass('active');

                if($('.box-nav-top')) {
                    $('html,body').animate({
                        scrollTop: $(id).offset().top-85
                    });
                }
            });

            $('a.scrollDivLong').on('click', function (e){
                e.preventDefault();

                var id = $(this).attr('href');
                $(this).parent().addClass("active").siblings().removeClass('active');

                if($('.box-nav-top')) {
                    $('html,body').animate({
                        scrollTop: $(id).offset().top-160
                    });
                }
            });

            $('.btn-collapse').on("click", function (e) {
                e.preventDefault();
                $('#box-collapse').toggle(300);
            });

            $('a.parent').on("click", function (e){
                $(this).next('ul').toggle();
                $(this).children('span:first').toggleClass("icon-down-arrow icon-right-arrow");
                e.stopPropagation();
                e.preventDefault();
            });

            $('.btn-toggle').on("click", function(e){
                $(this).next('ul').toggleClass("active");
                $(this).toggleClass("active");
                e.stopPropagation();
                e.preventDefault();
            });

            $('.show_frmSearch').click(function (e){
                e.preventDefault();
                $('#timke').toggle();
            });
            $('.show_frmSearch2').click(function (e){
                e.preventDefault();
                $('#timke2').toggle();
            });

            // var delay = ( function() {
            //   var timer = 0;
            //   return function(callback, ms) {
            //       clearTimeout (timer);
            //       timer = setTimeout(callback, ms);
            //   };
            // })();

            // Start scroll cate
            const menuCate = document.querySelector('#nav-cate-home');
            // const cateh = document.querySelector('#wrap_scroll_cate');
            // const searchh = document.querySelector('.search_load');
            // const scrollCate = $('.breadcrumb-item > .dropdown-menu');

            if($(menuCate)[0]){
                const menuCate_h = new PerfectScrollbar(menuCate, {
                    suppressScrollX: true
                });
                console.log('show menu cate horizontal');
            }
            // if($(cateh)[0]){
            //     const cate_h = new PerfectScrollbar(cateh);
            //     console.log('show menu cate horizontal');
            // }
            // if($('.breadcrumb-item > .dropdown-menu')[0]){
            //     const scroll_Cate = new PerfectScrollbar(scrollCate);
            //     console.log('show menu cate hover');
            // }
            // End scroll cate

            
            $('.home_gallery_area').lightGallery({
                selector: '.lightgallery',
                thumbnail:true,
                animateThumb: false,
                showThumbByDefault: true,
                autoplayControls: false,
                getCaptionFromTitleOrAlt: false,
                download: false,
                youtubePlayerParams: {
                    modestbranding: 1,
                    showinfo: 0,
                    rel: 0,
                    controls: 1
                },
                //actualSize: false,
                //zoom: false,
                rotate: false,
                flipHorizontal: false,
                flipVertical: false,
                share: false
            }); 

            
            $('[data-toggle="tooltip"]').tooltip();  
            

        });
        return true;
    }
    /* End excute js onload page Area js
    ============================================================================================ */


    // Start get height body js
    function calculateHeightBody() {
        var heightDocument = $('body').innerHeight();
        var heightWindow = $(window).height();

        var body = document.getElementById("body_fpt_online");
        var att = document.createAttribute("data-height-small");

        if (heightDocument < heightWindow) {
            att.value = "true";
            body.setAttributeNode(att);
        } else {
            att.value = "false";
            body.setAttributeNode(att);
        }
    }
    /* End get height body js
    ============================================================================================ */


    /* Start Gallery Grid Area js
    ============================================================================================ */
    function _galleryGrid() {
        var gallery_grid = $('#js_gallery_grid');
        if (gallery_grid[0]) {
            gallery_grid.gridrotator({
                rows: 5,
                columns: 12,
                interval: 2500,
                animType: 'fadeInOut',
                animSpeed: 600,
                onhover: false,
                w1650: {
                    rows: 5,
                    columns: 10
                },
                w1024: {
                    rows: 8,
                    columns: 8
                },
                w768: {
                    rows: 8,
                    columns: 7
                },
                w480: {
                    rows: 8,
                    columns: 5
                },
                w320: {
                    rows: 8,
                    columns: 4
                },
                w240: {
                    rows: 8,
                    columns: 3
                }
            });
        }
    }
    /* End Gallery Grid Area js
    ============================================================================================ */


    /* Start counterUp Number Area js
    ============================================================================================ */
    function _counterUp() {
        var items_couter_up = $('.js_counters_up .js_item_counter');
        if (items_couter_up[0]) {
            items_couter_up.each(function() {
                var e = $(this).attr('data-to');
                $(this).delay(3e3).countTo({
                    from: 1,
                    to: e,
                    speed: 3500,
                    refreshInterval: 50
                });
            });
        }
    }
    /* End counterUp Number Area js
    ============================================================================================ */


    // Start Set auto height slide home Area js
    function setHeightSlideHome() {
        var slideBannerHome = $('#slide_home .find_height_slide_home');
        if (slideBannerHome[0]) {
            var width_slide = slideBannerHome.innerWidth();
            var height_slide = width_slide * 7 / 20;
            slideBannerHome.height(height_slide);
        }
    }
    /* End Set auto height slide home Area js
    ============================================================================================ */


    /* Start feature elements fixed Area js
    ============================================================================================ */
    function _initCheckScroll(){
        //console.log('Toi dang dung o day');

        var total_scroll_height,inside_header,passed_header,passed_header2,footer_reached;
        var menu_d,header_fixed;

        total_scroll_height = document.body.scrollHeight;
        inside_header = ($(this).scrollTop() <= 150);
        passed_header = ($(this).scrollTop() >= 0);
        passed_header2 = ($(this).scrollTop() >= 150);
        footer_reached = ($(this).scrollTop() >= (total_scroll_height - ($(window).height() + 300)));

        //var menu_a = $('.menu-top').outerHeight();
        menu_d = $('.header.header-sticky');
        header_fixed = ($(this).scrollTop() > 0);

        if (inside_header === true) {
            $('.back-to-top-badge').removeClass('back-to-top-badge-visible');
            $('.btn-go-top').removeClass('show');
        } else if (passed_header === true) {
            $('.back-to-top-badge').addClass('back-to-top-badge-visible');
            $('.btn-go-top').addClass('show');
        }
        // An nut khi scroll den cuoi
        // if (footer_reached == true) {
        //     $('.back-to-top-badge').removeClass('back-to-top-badge-visible');
        // }

        // if($('.header.header-scroll')[0] && $(window).width()>1200){
        if (menu_d[0]){
            if (header_fixed === true) {
                menu_d.addClass('add-background');
            }else{
                menu_d.removeClass('add-background');
            }
        }
    }
    /* End feature elements fixed Area js
    ============================================================================================ */


    /* Demo Area js
    ============================================================================================ */
    function _initEvents() {
        sections.forEach(function (element) {
            element.onclick = function() {
                _openSection(this);
            };
        });
        closeButtons.forEach(function (element) {
            element.onclick = function (element) {
                element.stopPropagation();
                _closeSection(this.parentElement);
            };
        });
    }


})();
