$(function () {

    // Service Auto height circle 
    function autoHeightCircle() {
        var circle = $('.circle--rotate'),
            circleInner = $('.animate-wrapper'),
            circleH = circle.width(),
            circleInnerH = circleInner.width();
        circle.height(circleH);
        circleInner.height(circleInnerH);
    }

    $("#circle--rotate").circle();
    autoHeightCircle();
    $(window).resize(function () {
        autoHeightCircle();
    });

    let _time = 3000;
    let _r = setInterval(clickPrev,_time);

    if (isMobile() == false) {
        $('#circle--rotate').hover(function(){
            clearInterval(_r)
        },function(){
            _r = setInterval(clickPrev,_time);
        })
    }
});

function clickPrev(){
        $('.rotate--circle .next').trigger('click');
    }

function isMobile() {
    return (/Android|iPhone|iPad|iPod|BlackBerry/i).test(navigator.userAgent || navigator.vendor || window.opera);
}



